/*********************************************************************
*
*       _SetupHand
*/
static void _SetupHand(int xSize, int ySize, GUI_POINT * pPoint, int Length, int NumItems) {
  I32 Alpha;
  int i;
  int r;
  int xPos;
  int yPos;
  I32 AlphaAdd;

  xPos = (xSize >> 1) * AA_FACTOR;
  yPos = (ySize >> 1) * AA_FACTOR;
  r = Length * AA_FACTOR;
  AlphaAdd = (360L * 1000L) / NumItems;
  for (Alpha = -90000, i = 0; i < NumItems; Alpha += AlphaAdd, i++) {
    pPoint->x = xPos + ((GUI__CosHQ(Alpha) * r) >> 16);
    pPoint->y = yPos + ((GUI__SinHQ(Alpha) * r) >> 16);
    pPoint++;
  }
}

/*********************************************************************
*
*       _DrawIndicator
*/
static void _DrawIndicator(GUI_POINT Point, GUI_COLOR Color, int PenSize) {
  int AAFactorOld;
  
  AAFactorOld = GUI_AA_GetFactor();
  GUI_AA_EnableHiRes();
  GUI_AA_SetFactor(AA_FACTOR);
  GUI_SetColor(Color);
  GUI_SetPenSize(PenSize);
  GUI_AA_DrawLine((LCD_GetXSize() >> 1) * AA_FACTOR, (LCD_GetYSize() >> 1) * AA_FACTOR, Point.x, Point.y);
  GUI_SetColor(COLOR_LIGHTBROWN);
  if (PenSize > 3) {
    GUI_SetPenSize(2);
    GUI_AA_DrawLine((LCD_GetXSize() >> 1) * AA_FACTOR, (LCD_GetYSize() >> 1) * AA_FACTOR, Point.x, Point.y);
  }
  GUI_AA_DisableHiRes();
  GUI_AA_SetFactor(AAFactorOld);
}

/*********************************************************************
*
*       _AnimateSecond
*/
static void _AnimateSecond(GUI_ANIM_INFO * pInfo, void * pVoid) {
  ANIM_DATA * pData;
  WM_MESSAGE Msg = {0};
  
  pData  = (ANIM_DATA *)pVoid;
  pData->Index = pData->LastIndex + (pData->Destination * pInfo->Pos) / GUI_ANIM_RANGE;
  pData->Time = pData->Index / 60;
  WM_InvalidateWindow(pData->hWin);
  if (pInfo->State == GUI_ANIM_END) {
    pData->LastIndex = pData->Index;
  }
  if (pData->Index >= pData->NumItems) {
    Msg.MsgId = MSG_ANIM_MINUTE;
    WM_BroadcastMessage(&Msg);
    pData->Index = 0;
    pData->LastIndex = 0;
  }
}

/*********************************************************************
*
*       _AnimateMinute
*/
static void _AnimateMinute(GUI_ANIM_INFO * pInfo, void * pVoid) {
  ANIM_DATA * pData;
  WM_MESSAGE Msg = {0};
  
  pData  = (ANIM_DATA *)pVoid;
  pData->Index = pData->LastIndex + (pData->Destination * pInfo->Pos) / GUI_ANIM_RANGE;
  pData->Time = pData->Index / 60;
  if (pData->Time == 60) {
    Msg.MsgId = MSG_ANIM_HOUR;
    WM_BroadcastMessage(&Msg);
  }
  WM_InvalidateWindow(pData->hWin);
  if (pInfo->State == GUI_ANIM_END) {
    pData->LastIndex = pData->Index;
  }
  if (pData->Index >= pData->NumItems) {
    pData->Index = 0;
    pData->LastIndex = 0;
  }
}

/*********************************************************************
*
*       _OnDelete
*/
static void _OnDelete(void * pVoid) {
  ANIM_DATA * pData;

  pData = (ANIM_DATA *)pVoid;
  pData->AnimInProgress = 0;
}

/*********************************************************************
*
*       _AnimateHour
*/
static void _AnimateHour(GUI_ANIM_INFO * pInfo, void * pVoid) {
  ANIM_DATA * pData;
  
  pData  = (ANIM_DATA *)pVoid;
  pData->Index = pData->LastIndex + (pData->Destination * pInfo->Pos) / GUI_ANIM_RANGE;
  pData->Time = pData->Index / 300;
  
  WM_InvalidateWindow(pData->hWin);
  if (pInfo->State == GUI_ANIM_END) {
    pData->LastIndex = pData->Index;
  }
  if (pData->Index >= pData->NumItems) {
    pData->Index = 0;
    pData->LastIndex = 0;
  }
}

/*********************************************************************
*
*       _cbClock
*/
static void _cbClock(WM_MESSAGE * pMsg) {
  static ANIM_DATA         aAnimData[3];
  static GUI_ANIM_HANDLE   ahAnim[3];
  int                      xSize;
  int                      ySize;
  int                      AAFactorOld;

  switch (pMsg->MsgId) {
  case WM_CREATE:
    xSize = LCD_GetXSize();
    ySize = LCD_GetYSize();
    _SetupHand(xSize, ySize, _aSecPos,  (xSize >> 1),  GUI_COUNTOF(_aSecPos));
    _SetupHand(xSize, ySize, _aMinPos,  (xSize >> 1) - 70,  GUI_COUNTOF(_aMinPos));
    _SetupHand(xSize, ySize, _aHourPos, (xSize >> 1) - 94, GUI_COUNTOF(_aHourPos));

    aAnimData[SECOND].hWin        = pMsg->hWin;
    aAnimData[SECOND].Index       = TIME_START_S(TIME_S);
    aAnimData[SECOND].NumItems    = GUI_COUNTOF(_aSecPos);
    aAnimData[SECOND].Destination = 60;
    aAnimData[SECOND].LastIndex   = TIME_START_S(TIME_S);
    
    aAnimData[MINUTE].hWin        = pMsg->hWin;
    aAnimData[MINUTE].Index       = TIME_START_M(TIME_M);
    aAnimData[MINUTE].Destination = 60;
    aAnimData[MINUTE].NumItems    = GUI_COUNTOF(_aMinPos);
    aAnimData[MINUTE].LastIndex   = TIME_START_M(TIME_M);

    aAnimData[HOUR].hWin        = pMsg->hWin;
    aAnimData[HOUR].Index       = TIME_START_H(TIME_H);
    aAnimData[HOUR].Destination = 6;
    aAnimData[HOUR].NumItems    = GUI_COUNTOF(_aHourPos);
    aAnimData[HOUR].LastIndex   = TIME_START_H(TIME_H);

    ahAnim[SECOND] = GUI_ANIM_Create(TIME_ANIM, 10, (void *)&aAnimData[SECOND], NULL);
    GUI_ANIM_AddItem(ahAnim[SECOND], 0, TIME_ANIM, ANIM_LINEAR, (void *)&aAnimData[SECOND], _AnimateSecond);
    GUI_ANIM_StartEx(ahAnim[SECOND], -1, NULL);
    break;
  case WM_PAINT:
    GUI_DrawBitmap(&BM_FACE, 0, 0);
    _DrawIndicator(_aHourPos[aAnimData[HOUR].Index],   GUI_BLACK, 8);
    _DrawIndicator(_aMinPos [aAnimData[MINUTE].Index], GUI_BLACK, 7);
    _DrawIndicator(_aSecPos [aAnimData[SECOND].Index], GUI_BLACK, 3);
    xSize = (LCD_GetXSize() >> 1) * AA_FACTOR;
    ySize = (LCD_GetYSize() >> 1) * AA_FACTOR;
    AAFactorOld = GUI_AA_GetFactor();
    GUI_AA_EnableHiRes();
    GUI_AA_SetFactor(AA_FACTOR);
    GUI_SetColor(GUI_BLACK);
    GUI_AA_FillCircle(xSize, ySize, 10 * AA_FACTOR);
    GUI_AA_SetFactor(AAFactorOld);
    GUI_AA_DisableHiRes();

    break;
  case MSG_ANIM_MINUTE:
    ahAnim[MINUTE] = GUI_ANIM_Create(300, 10, (void *)&aAnimData[MINUTE], NULL);
    GUI_ANIM_AddItem(ahAnim[MINUTE], 0, 300, ANIM_ACCELDECEL, (void *)&aAnimData[MINUTE], _AnimateMinute);
    GUI_ANIM_StartEx(ahAnim[MINUTE], 1, NULL);
    break;
  case MSG_ANIM_HOUR:
    ahAnim[HOUR] = GUI_ANIM_Create(1000, 10, (void *)&aAnimData[HOUR], NULL);
    GUI_ANIM_AddItem(ahAnim[HOUR], 0, 1000, ANIM_ACCELDECEL, (void *)&aAnimData[HOUR], _AnimateHour);
    GUI_ANIM_StartEx(ahAnim[HOUR], 1, _OnDelete);
    break;
  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

