/*********************************************************************
*
*       MainTask
*/
void MainTask(void);
void MainTask(void) {
  int xSize;
  int ySize;

  GUI_Init();
  WM_MULTIBUF_Enable(1);
  xSize = LCD_GetXSize();
  ySize = LCD_GetYSize();
  WM_SetSize(WM_HBKWIN, xSize, ySize);
  WM_CreateWindowAsChild(0, 0, xSize, ySize, WM_HBKWIN, WM_CF_SHOW, _cbClock, 0);
  while (1) {
    GUI_Delay(100);
  }
}

